import React from 'react'
import { Route, Switch } from 'react-router-dom';
import "./App.css"
import RiddlePage from './RiddlePage'
import { introText } from './riddles'

const introCard = () => {
	return (
		<div class="card blue-grey darken-1">
			<div class="card-content white-text">
				<span class="card-title">Загадки Эллы</span>
				<p>{introText}</p>
			</div>
			<div class="card-action">
				<a class="waves-effect waves-light btn" href="/1">Идти</a>
			</div>
		</div>
	)
}

const App = () => {
	return (
		<div className="App">
			<Switch>
				<Route path="/" component={introCard} exact />
				<Route path="/1" component={RiddlePage} />
				<Route path="/2" component={RiddlePage} />
			</Switch>

		</div>
	);
}

export default App;
